import React from 'react';
import {Panel, PanelGroup} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';

export type FaqVProps = {
  faqData?: any[];
};

const faqData = [
  {
    heading:"FAQ"
  },
  {
    Question: 'how are you',
    Answer: 'answer',
  },
  {
    Question: 'hey this is FAQ',
    Answer: 'this is answer',
  },
];

const faqV = (props: FaqVProps) => {
  const output: any = [];
  const getFaq = () => {
    Array.isArray(props?.faqData) && props?.faqData.forEach(items => {
        output.push(





            <Panel header={items.data.Question}>{items.data.Answer}</Panel>

        );
      });
    return output;
  };

  return (
    <div>
        {/* <h3>{props?.faqData.heading}</h3> */}
    <PanelGroup accordion bordered>

      {getFaq()}
    </PanelGroup>
    </div>
  );
};

export default faqV;
